import React, { Component } from 'react';
import './App.css';
import Person from './Person/Person';

class App extends Component {
  state = {
    persons: [
      {name:'Modestas', age:25},
      {name:'Tadas', age:55}
    ]
  };

  returnPersons() {
    this.state.persons.forEach((person, index) => {
      console.log(this.state.persons[index].name)
      return <Person name={this.state.persons[index].name} age={this.state.persons[index].age} />
    })
  };

  render() {
    return (
      <div className="App">
        <Person name={this.state.persons[0].name} age={this.state.persons[0].age} />
        <Person name={this.state.persons[1].name} age={this.state.persons[1].age}> Is an old person </Person>
        <hr/>
        {this.returnPersons()}
      </div>
    );
  }
}

export default App;
